import React from 'react'
import Tourcard from '../Shared/Tourcard'
import TourData from '../../assets//data/tours'
import { Col } from 'reactstrap'

import useFetch from '../../hooks/useFetch'
import {BASE_URL} from '../../Utilis/config.js'

const Featurelist = () => {
  const {data  :featuredTours } = useFetch(`${BASE_URL}/search/tours/getTourByFeatured`)

  console.log(featuredTours);
  return (
    <>
    {/* Mapping  of TourData if exits via tours displaying in TourCard */}
    {TourData?.map(tour=> (
       <Col lg='3' className='mp-5' key={tour.id}> 
        <Tourcard tour={tour}/>
       </Col>
    ))}
    </>
  );
};

export default Featurelist
